// src/components/StudentRow.js
import React from 'react';
import FileList from './FileList';
import FileUploader from './FileUploader'; // Make sure this component is implemented

const StudentRow = ({ student, onGradeChange, onCommentChange, onFileUpload }) => {
  return (
    <div className="student-row">
      <input
        type="text"
        value={student.name}
        onChange={(e) => onGradeChange(e)}
        placeholder="Enter student name"
      />
      <FileUploader onUploadSuccess={(file) => onFileUpload(file)} />
      <FileList files={student.files} />
      <input
        type="text"
        value={student.grade}
        onChange={(e) => onGradeChange(e)}
        placeholder="Enter grade"
      />
      <input
        type="text"
        value={student.comment}
        onChange={(e) => onCommentChange(e)}
        placeholder="Enter comments"
      />
    </div>
  );
};

export default StudentRow;
